Changeling (2008) 

Verenigde Staten
Drama
140 minuten

geregisseerd door Clint Eastwood
met Angelina Jolie, John Malkovich en Michael Kelly

Op een dag verdwijnt Walter, het zoontje van Christine Collins. Ze schakelt de politie in die haar pas laat serieus neemt. Dan wordt Walter gevonden, maar Christine meldt onmiddellijk bij de LAPD dat deze knaap niet haar zoon is. De corrupte politie van L.A ligt op dat moment onder vuur in de media en kan de vondst van de verdwenen jongen goed gebruiken. Christine wordt dan ook niet serieus genomen. Ondertussen ligt de zoektocht naar de echte Walter Collins stil en tikt de klok door.



